// firebase.js
import { initializeApp } from "firebase/app";
import { 
  getAuth, 
  GoogleAuthProvider, 
  signInWithPopup, 
  signInWithRedirect, 
  signOut
} from "firebase/auth";

// ðŸ”¹ Replace with your Firebase project credentials
const firebaseConfig = {
  apiKey: "AIzaSyDN-ty61fp6sUoLngRbpwt9FBnQ2bgv5Qo",
  authDomain: "health-card-500.firebaseapp.com",
  projectId: "health-card-500",
  storageBucket: "health-card-500.firebasestorage.app",
  messagingSenderId: "419257747870",
  appId: "1:419257747870:web:fedba0ae2bdb9fccd6ee8f",
  measurementId: "G-Y2YLGHVJV4"
};

const app = initializeApp(firebaseConfig);
const auth = getAuth(app);
const provider = new GoogleAuthProvider();

export { auth, provider, signInWithPopup, signInWithRedirect, signOut };
